import React from 'react';
import './App.css';
import { Provider } from "react-redux";

import { store } from "./actions/store";
import { Container, AppBar, Typography } from "@material-ui/core";
import ButterToast,{ POS_RIGHT,POS_TOP } from "butter-toast";
import ModalComponent from './components2/ModalComponent';
import TableComponent from './components2/TableComponent';
import FormComponent from './components2/FormComponent';

function App() {
  return (
    <Provider store={store}>
      <Container maxWidth="lg">

        {/* <PostMessages /> */}
        <ModalComponent title="Add">
      <FormComponent type="add"/>
        </ModalComponent>
        <TableComponent/>
        <ButterToast position={{vertical:POS_TOP,horizontal:POS_RIGHT}}/>
      </Container>
    </Provider>
  );
}

export default App;
